public class ReadDoc {
	@SuppressWarnings("unused")
	public static String readDoc(String base64) {
		HttpResponse<String> response = Unirest.post("https://phenoml-hackathon.app.pheno.ml/lang2fhir/document")
		  .header("Content-Type", "application/json")
		  .header("Authorization", "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJjb2xsZWN0aW9uSWQiOiJfcGJfdXNlcnNfYXV0aF8iLCJleHAiOjE3NTcxODMyNTMsImlkIjoiN3kxeHdhNXAzNWlnOGhwIiwidHlwZSI6ImF1dGhSZWNvcmQifQ.0pshVK9zTxFz3UwXc00hdEwJ3_B54qgsHH0Llmg8ZAk")
		  .body("{\n"
				    + "  \"resource\": \"questionnaire\",\n"
				    + "  \"fileType\": \"application/pdf\",\n"
				    + "  \"content\": \"" + base64 + "\",\n"
				    + "  \"version\": \"R4\"\n"
				    + "}")
		  .asString();
		
		String body = response.getBody();
		Integer status = response.getStatus();
		
		
		if(status != 200) {
			response = Unirest.post("https://phenoml-hackathon.app.pheno.ml/lang2fhir/document")
			  .header("Content-Type", "application/json")
			  .header("Authorization", "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJjb2xsZWN0aW9uSWQiOiJfcGJfdXNlcnNfYXV0aF8iLCJleHAiOjE3NTcxODMyNTMsImlkIjoiN3kxeHdhNXAzNWlnOGhwIiwidHlwZSI6ImF1dGhSZWNvcmQifQ.0pshVK9zTxFz3UwXc00hdEwJ3_B54qgsHH0Llmg8ZAk")
			  .body("{\n  \"resource\": \"questionnaire\",\n  \"fileType\": \"application/pdf\",\n  \"content\": \"\",\n  \"version\": \"R4\"\n}")
			  .asString();
			body = response.getBody();
		}
		return body;
	}

}
